// posts
const TestPostsComponent = () => {
    const { posts, fetchPosts } = useContext(PostsContext);
    fetchPosts(1);
    return (
        <div>
            {posts && posts.length > 0 && 
            <div role="exists">There are posts!</div>}
        </div>
    )
}

test('fetch Posts', async () => {
    render (
        <Provider>
            <TestPostsComponent />
        </Provider>
    );
    await waitFor(() => {
        expect(screen.getByRole('exists')).toBeInTheDocument();
    })
})

//delete
const TestDeleteComponent = () => {
    const { posts, fetchPosts, deletePostById } = useContext(PostsContext);
    fetchPosts(1);
    return (
        <div>
            {(posts.filter((post) => {return post.id == 7}).length == 1) && 
                <div role="before">Post with id 7 is in the list</div> 
            } 
            <button
                onClick={() => {
                    deletePostById(7);
                }}
            >Delete Post</button>
            {(posts.filter((post) => {return post.id == 7}).length == 0) && 
                <div role="after">Post with id 7 was deleted</div> 
            } 
        </div>
    )
}

test('delete Post', async () => {
    render (
        <Provider>
            <TestDeleteComponent />
        </Provider>
    );
    await waitFor(() => {
        const before = screen.getByRole('before');
        expect(before).toBeInTheDocument();
    });
    user.click(screen.getByRole('button', {name: "Delete Post"}));
    await waitFor(() => {
        const after = screen.getByRole('after');
        expect(after).toBeInTheDocument();
    });
})

 //create
const TestCreatePostComponent = () => {
    const { posts, fetchPosts, createPost } = useContext(PostsContext);
    const { user, fetchUser } = useContext(UserContext);
    
    fetchUser("duckdonald", "password");
    fetchPosts(1);
    return (
        <div>
            {(posts.filter((post) => {return post.title === "This is a test"}).length === 0) && 
                <div role="before">Post with title This is a Test is NOT in the list.</div> 
            } 
            <button
                onClick={() => {
                    console.log("clicked");
                    const newPost = {
                        "userId": 1,
                        "title": "This is a test",
                        "content": "Test content",
                        "datetime": "1526682796",
                        "category": "technology",
                    };
                    createPost(newPost, user);
                }}
            >Create Post</button>
            {(posts.filter((post) => {return post.title === "This is a test"}).length === 1) && 
                <div role="after">Post with title This is a Test was created.</div> 
            } 
        </div>
    )
}

test('Create Post', async () => {
    render (
        <UserProvider>
            <Provider>
                <TestCreatePostComponent />
            </Provider>
        </UserProvider>
    );
    await waitFor(() => {
        const before = screen.getByRole('before');
        expect(before).toBeInTheDocument();
    });
    user.click(screen.getByRole('button', {name: "Create Post"}));
    await waitFor(() => {
        const after = screen.getByRole('after');
        expect(after).toBeInTheDocument();
    });
})

